import React, { useState } from 'react';
import {
  Box,
  VStack,
  FormControl,
  FormLabel,
  Input,
  Select,
  Button,
  Text,
  useToast,
} from '@chakra-ui/react';

interface TradeForm {
  sourcePlanet: string;
  destinationPlanet: string;
  goods: string;
  quantity: number;
  paymentType: 'upfront' | 'on_delivery';
}

export const TradePanel: React.FC = () => {
  const [form, setForm] = useState<TradeForm>({
    sourcePlanet: 'Earth',
    destinationPlanet: 'Mars',
    goods: '',
    quantity: 0,
    paymentType: 'upfront',
  });

  const toast = useToast();

  const calculateInterest = (distance: number, paymentType: 'upfront' | 'on_delivery'): number => {
    // Simplified calculation based on Krugman's paper
    const speedOfLight = 299792458; // m/s
    const timeDilationFactor = 1 / Math.sqrt(1 - (0.9 * speedOfLight) ** 2 / (speedOfLight ** 2));
    const baseInterestRate = 0.05; // 5% per year

    if (paymentType === 'upfront') {
      return baseInterestRate * timeDilationFactor;
    } else {
      return baseInterestRate * timeDilationFactor * 2; // Higher interest for payment on delivery
    }
  };

  const handleSubmit = () => {
    const distance = 1.5; // Simplified distance between planets
    const interestRate = calculateInterest(distance, form.paymentType);

    toast({
      title: 'Trade Calculation',
      description: `Interest Rate: ${(interestRate * 100).toFixed(2)}%`,
      status: 'info',
      duration: 5000,
      isClosable: true,
    });
  };

  return (
    <Box p={4} bg="white" borderRadius="lg" boxShadow="md">
      <VStack spacing={4} align="stretch">
        <Text fontSize="xl" fontWeight="bold">Interstellar Trade</Text>

        <FormControl>
          <FormLabel>Source Planet</FormLabel>
          <Select
            value={form.sourcePlanet}
            onChange={(e) => setForm({ ...form, sourcePlanet: e.target.value })}
          >
            <option value="Earth">Earth</option>
            <option value="Mars">Mars</option>
            <option value="Jupiter">Jupiter</option>
          </Select>
        </FormControl>

        <FormControl>
          <FormLabel>Destination Planet</FormLabel>
          <Select
            value={form.destinationPlanet}
            onChange={(e) => setForm({ ...form, destinationPlanet: e.target.value })}
          >
            <option value="Earth">Earth</option>
            <option value="Mars">Mars</option>
            <option value="Jupiter">Jupiter</option>
          </Select>
        </FormControl>

        <FormControl>
          <FormLabel>Goods</FormLabel>
          <Input
            value={form.goods}
            onChange={(e) => setForm({ ...form, goods: e.target.value })}
            placeholder="Enter goods description"
          />
        </FormControl>

        <FormControl>
          <FormLabel>Quantity</FormLabel>
          <Input
            type="number"
            value={form.quantity}
            onChange={(e) => setForm({ ...form, quantity: Number(e.target.value) })}
          />
        </FormControl>

        <FormControl>
          <FormLabel>Payment Type</FormLabel>
          <Select
            value={form.paymentType}
            onChange={(e) => setForm({ ...form, paymentType: e.target.value as 'upfront' | 'on_delivery' })}
          >
            <option value="upfront">Pay Upfront</option>
            <option value="on_delivery">Pay on Delivery</option>
          </Select>
        </FormControl>

        <Button colorScheme="blue" onClick={handleSubmit}>
          Calculate Trade
        </Button>
      </VStack>
    </Box>
  );
};
